import { Component } from '@angular/core';
import { Model } from './model';

@Component({
  selector: 'app-to-do',
  templateUrl: './to-do.component.html',
  styleUrls: ['./to-do.component.css']
})
export class ToDoComponent {
  model=new Model();
  getItems(){
    return this.model.items;
  }
}
